import React, { useState } from "react";
import Purchase from "../assets/icon/purchase.svg";
import Register from "../assets/icon/register.svg";
import { Link } from "react-router-dom";
import '../css/productIcon.css';

const ProductIcon = () => {
  return (
    <footer className="picon">
      <Link to='/ProductRegistration'>
        <li style={{ marginLeft: '23px' }}>
          <img className=" w-12 h-12" src={Purchase} alt="purchase" />
          <strong>등록</strong>
        </li>
      </Link>
      <li style={{ marginLeft: '23px' }}>
        <img className=" w-12 h-12" src={Register} alt="register" />
        <strong>등록</strong>
      </li>
    </footer >
  );
}

export default ProductIcon;
